import Object = require('nashorn/java/lang/Object');
import Enumeration = require('nashorn/java/util/Enumeration');

declare class Dictionary<K, V> extends Object {
	empty : boolean;
	constructor();
	size() : number;
	isEmpty() : boolean;
	keys() : Enumeration<K>;
	elements() : Enumeration<V>;
	get(arg1 : Object) : V;
	put(arg1 : K, arg2 : V) : V;
	remove(arg1 : Object) : V;
}

export = Dictionary
